import ComputerIcon from '@mui/icons-material/Computer';
import CodeIcon from '@mui/icons-material/Code';

function renderSwitch(param) {
    switch(param) {
        case "design":
            return <FormatColorFillIcon sx={{ width: 60, height: 60, color: "black"}} />
  
        case "developer":
            return <FormatColorFillIcon sx={{ width: 60, height: 60, color: "black"}} />
        case "backend":
            return <FormatColorFillIcon sx={{ width: 60, height: 60, color: "black"}} />
    }
  }

export default function MyData(props){

 
      
    return(
        <div style={{width:"450px",marginTop:'5vh'}}>
            <Avatar
                alt="Tech"
                sx={{ width: 90, height: 90 ,backgroundColor:"#42FFC4",margin:'3vh auto'}}
            >
            {renderSwitch(props.icon)}  
                
            </Avatar>

            <h1>Designer</h1>
            
            <p>Tempor ipsum officia occaecat anim in incididunt aliquip consequat dolore sint velit.</p>

