            <p>UX/UI , Web ,Logos </p>

            <h5 style={{color:"blue"}}>Design Tools</h5>

                <p>Adobe Express</p>
                <p>Canvas</p>
                <p>Wix</p>
                <p>Just in Mind</p>


        </div>
    );
}
